using System;
using System.Diagnostics;
using System.IO;
using System.Management.Automation;
using System.Management.Automation.Host;
using System.Management.Automation.Runspaces;
using System.Text;
using System.Text.RegularExpressions;
using System.Threading;

namespace ik.PowerShell;

internal class PS2EXE : PS2EXEApp
{
	private bool shouldExit;

	private int exitCode;

	public bool ShouldExit
	{
		get
		{
			return shouldExit;
		}
		set
		{
			shouldExit = value;
		}
	}

	public int ExitCode
	{
		get
		{
			return exitCode;
		}
		set
		{
			exitCode = value;
		}
	}

	[MTAThread]
	private static int Main(string[] args)
	{
		//IL_04b8: Unknown result type (might be due to invalid IL or missing references)
		//IL_04be: Invalid comparison between Unknown and I4
		PS2EXE pS2EXE = new PS2EXE();
		bool flag = false;
		string text = string.Empty;
		PS2EXEHostUI ui = new PS2EXEHostUI();
		PS2EXEHost pS2EXEHost = new PS2EXEHost(pS2EXE, ui);
		ManualResetEvent mre = new ManualResetEvent(initialState: false);
		AppDomain.CurrentDomain.UnhandledException += CurrentDomain_UnhandledException;
		try
		{
			Runspace val = RunspaceFactory.CreateRunspace((PSHost)(object)pS2EXEHost);
			try
			{
				val.set_ApartmentState(ApartmentState.MTA);
				val.Open();
				PowerShell powershell = PowerShell.Create();
				try
				{
					Console.CancelKeyPress += delegate(object sender, ConsoleCancelEventArgs e)
					{
						try
						{
							powershell.BeginStop((AsyncCallback)delegate
							{
								mre.Set();
								e.Cancel = true;
							}, (object)null);
						}
						catch
						{
						}
					};
					powershell.set_Runspace(val);
					powershell.get_Streams().get_Error().add_DataAdded((EventHandler<DataAddedEventArgs>)delegate(object sender, DataAddedEventArgs e)
					{
						((PSHostUserInterface)ui).WriteErrorLine(((object)((PSDataCollection<ErrorRecord>)sender).get_Item(e.get_Index())).ToString());
					});
					PSDataCollection<string> val2 = new PSDataCollection<string>();
					val2.Complete();
					PSDataCollection<PSObject> colOutput = new PSDataCollection<PSObject>();
					colOutput.add_DataAdded((EventHandler<DataAddedEventArgs>)delegate(object sender, DataAddedEventArgs e)
					{
						((PSHostUserInterface)ui).WriteLine(((object)colOutput.get_Item(e.get_Index())).ToString());
					});
					int num = 0;
					int num2 = 0;
					foreach (string text2 in args)
					{
						if (string.Compare(text2, "-wait", ignoreCase: true) == 0)
						{
							flag = true;
						}
						else if (text2.StartsWith("-extract", StringComparison.InvariantCultureIgnoreCase))
						{
							string[] array = text2.Split(new string[1] { ":" }, 2, StringSplitOptions.RemoveEmptyEntries);
							if (array.Length != 2)
							{
								Console.WriteLine("If you specify the -extract option you need to add a file for extraction in this way\r\n   -extract:\"<filename>\"");
								return 1;
							}
							text = array[1].Trim(new char[1] { '"' });
						}
						else
						{
							if (string.Compare(text2, "-end", ignoreCase: true) == 0)
							{
								num = num2 + 1;
								break;
							}
							if (string.Compare(text2, "-debug", ignoreCase: true) == 0)
							{
								Debugger.Launch();
								break;
							}
						}
						num2++;
					}
					string @string = Encoding.UTF8.GetString(Convert.FromBase64String(""));
					if (!string.IsNullOrEmpty(text))
					{
						File.WriteAllText(text, @string);
						return 0;
					}
					powershell.AddScript(@string);
					string text3 = null;
					Regex regex = new Regex("^-([^: ]+)[ :]?([^:]*)$");
					for (int j = num; j < args.Length; j++)
					{
						Match match = regex.Match(args[j]);
						if (match.Success && match.Groups.Count == 3)
						{
							if (text3 != null)
							{
								powershell.AddParameter(text3);
							}
							if (match.Groups[2].Value.Trim() == "")
							{
								text3 = match.Groups[1].Value;
							}
							else if (!(match.Groups[2].Value == "True") && !(match.Groups[2].Value.ToUpper() == "$TRUE"))
							{
								if (!(match.Groups[2].Value == "False") && !(match.Groups[2].Value.ToUpper() == "$FALSE"))
								{
									powershell.AddParameter(match.Groups[1].Value, (object)match.Groups[2].Value);
									text3 = null;
								}
								else
								{
									powershell.AddParameter(match.Groups[1].Value, (object)false);
									text3 = null;
								}
							}
							else
							{
								powershell.AddParameter(match.Groups[1].Value, (object)true);
								text3 = null;
							}
						}
						else if (text3 != null)
						{
							powershell.AddParameter(text3, (object)args[j]);
							text3 = null;
						}
						else
						{
							powershell.AddArgument((object)args[j]);
						}
					}
					if (text3 != null)
					{
						powershell.AddParameter(text3);
					}
					powershell.AddCommand("out-string");
					powershell.AddParameter("stream");
					powershell.BeginInvoke<string, PSObject>(val2, colOutput, (PSInvocationSettings)null, (AsyncCallback)delegate(IAsyncResult ar)
					{
						if (ar.IsCompleted)
						{
							mre.Set();
						}
					}, (object)null);
					while (!pS2EXE.ShouldExit && !mre.WaitOne(100))
					{
					}
					powershell.Stop();
					if ((int)powershell.get_InvocationStateInfo().get_State() == 5)
					{
						((PSHostUserInterface)ui).WriteErrorLine(powershell.get_InvocationStateInfo().get_Reason().Message);
					}
				}
				finally
				{
					if (powershell != null)
					{
						((IDisposable)powershell).Dispose();
					}
				}
				val.Close();
			}
			finally
			{
				((IDisposable)val)?.Dispose();
			}
		}
		catch (Exception ex)
		{
			Console.Write("An exception occured: ");
			Console.WriteLine(ex.Message);
		}
		if (flag)
		{
			Console.WriteLine("Hit any key to exit...");
			Console.ReadKey();
		}
		return pS2EXE.ExitCode;
	}

	private static void CurrentDomain_UnhandledException(object sender, UnhandledExceptionEventArgs e)
	{
		throw new Exception("Unhandled exception in PS2EXE");
	}
}
